import React from "react";
import { useNavigate } from "react-router-dom";

const AuthPage = () => {
  const navigate = useNavigate();

  return (
    <div 
      className="flex flex-col items-center justify-center h-screen bg-cover bg-center" 
      style={{ backgroundImage: "https://thumbs.dreamstime.com/b/girl-child-hold-book-stretching-white-interior-kid-school-uniform-making-exercise-stretching-increase-productivity-exercises-132330329.jpg" }}
    >
      <div className="bg-white bg-opacity-80 p-8 rounded-lg shadow-lg text-center">
        <h1 className="text-3xl font-bold mb-6">Study Tracker</h1>

        <div className="space-x-4">
          <button onClick={() => navigate("/register")} className="px-6 py-2 bg-green-500 text-white rounded">Register</button>
          <button onClick={() => navigate("/login")} className="px-6 py-2 bg-blue-500 text-white rounded">Login</button>
        </div>
      </div>
    </div>
  );
};

export default AuthPage;
